description:
Interrabang (Italy - 1969)

Thriller
 &lt;a href=&quot;
http://www.imdb.com/title/tt0064488/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.imdb.com/title/tt0064488/&lt;/a&gt;


A photographer is sailing with his wife, her sister, and his nymphomaniacal model. He leaves the three women alone to get a part for his boat. A mysterious man shows up, who might be an escaped criminal the police are searching for. This doesn't alarm the three women too much, and he rapidly seduces each of them. Nor are they particularly worried about the dead body of a police officer that appears and then vanishes. These woman are such bored, jaded bourgeoisie types that they don't even seem to care that this handsome stranger might be planning to kill them. The ending combines the surprise plot twists and throws in yet another nasty surprise to boot. Both the scenery and the actors are gorgeous.


Video: XviD, 688x304, 25.000 fps, 1535 Kbps, 01h33m10s
Audio: MP3, 48000 Hz, stereo, 102 kbps

DVDRip with Italian audio
